import React from 'react';

const JourneyInput = () => {
    return (
        <div className="D-box">
            <form>
                enter a contact number:<br/>
                <input required name="duration" type="tel"></input>
                <button>Start</button>
            </form>
            <form>
                enter a countdown time:<br/>
                <input required name="duration" type="number"></input>
                <button>Start</button>
            </form>
        </div>
    );
};

export default JourneyInput;
